//import {getInitialProps} from 'next';
import {useEffect, useState} from 'react';

const Index = (dados) => {
    const [clientes, setClientes] = useState([]);
    console.log(clientes);

    useEffect(async ()=>{
        const response = await axios.get(
            'http://localhost:8080/'
        );
        setClientes(response.data);
        
    },[]);
    return (
        <div>
              <form>
                    <input id="name" name="name" type="text" placeholder="Primeiro nome"></input>
                    <input id="sobrenome" name="sobrenome" type="text" placeholder="Sobrenome"></input>
                    <input id="email" name="email" type="text" placeholder="Email"></input>
                    <select name="place">
                        <option value="rs">Rio Grande do Sul</option>
                        <option value="sc">Santa Catarina</option>
                        <option value="pr">Paran√°</option>
                    </select>
                    <input type="submit" value="INSCREVA-SE"/>
                </form>
        </div>
    );
};
    
export default Index;
